import React from 'react';
import TaskItem from './TaskItem';

class TasksList extends React.Component {
    render() {
        const {tasks, selected} = this.props;
        const renderTasks = tasks
            .map(t => {
            return (
                <TaskItem key={t.text} task={t} />
            );
        });
        return (
            <div className="tasks">
                <h5>Tasks</h5>
                {renderTasks}
            </div>
        );
    }
}

export default TasksList;
